export const addAccount = (data) => {
    return (dispatch) => {
      console.log(data);
      console.log(JSON.stringify(data));
      fetch("http://localhost:3000/api/v1/accounts", {
        headers: {
          "Contet-Type": "application/json",
          "Accept": "/*/",
        },
        method: "POST",
          body: JSON.stringify(data),
      });
    };
};
